using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class Usuario	{		private Guid usuarioKey;		private string nombres;		private string nickname;
        public string password { get; set; }
	    private string apPaterno;		private string apMaterno;		private string domicilio;		private string telefono;		private string correo;		private double? cuotaPago;		private bool? baja;		private bool? bilingue;		private DateTime? creationDate;		private Guid? departamentoFk;		private Guid? officeFk;		public Usuario(){}		public Guid UsuarioKey		{			get { return usuarioKey; }			set { usuarioKey = value; }		}		public string Nombres		{			get { return nombres; }			set { nombres = value; }		}		public string Nickname		{			get { return nickname; }			set { nickname = value; }		}		public string ApPaterno		{			get { return apPaterno; }			set { apPaterno = value; }		}		public string ApMaterno		{			get { return apMaterno; }			set { apMaterno = value; }		}		public string Domicilio		{			get { return domicilio; }			set { domicilio = value; }		}		public string Telefono		{			get { return telefono; }			set { telefono = value; }		}		public string Correo		{			get { return correo; }			set { correo = value; }		}		public double? CuotaPago		{			get { return cuotaPago; }			set { cuotaPago = value; }		}		public bool? Baja		{			get { return baja; }			set { baja = value; }		}		public bool? Bilingue		{			get { return bilingue; }			set { bilingue = value; }		}
        public DateTime? CreationDate		{			get { return creationDate; }			set { creationDate = value; }		}		public Guid? DepartamentoFk		{			get { return departamentoFk; }			set { departamentoFk = value; }		}		public Guid? OfficeFk		{			get { return officeFk; }			set { officeFk = value; }		}	}}